import{_ as e,o as r,c as o,O as t}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 54.1-531 Suspension, revocation, or refusal to renew registration.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-531.md","filePath":"vacode/54.1-531.md"}'),a={name:"vacode/54.1-531.md"},i=t('<h1 id="§-54-1-531-suspension-revocation-or-refusal-to-renew-registration" tabindex="-1">§ 54.1-531 Suspension, revocation, or refusal to renew registration. <a class="header-anchor" href="#§-54-1-531-suspension-revocation-or-refusal-to-renew-registration" aria-label="Permalink to &quot;§ 54.1-531 Suspension, revocation, or refusal to renew registration.&quot;">​</a></h1><p>A. The Director may limit, suspend, revoke, or refuse to renew a registration of an individual registered under subsection A of § <a href="/vacode/54.1-530/">54.1-530</a> for conduct that would have justified refusal to issue a certificate of registration under subsection B of § <a href="/vacode/54.1-530/">54.1-530</a>.</p><p>B. The Director may suspend or revoke the registration of an individual registered under subsection C of § <a href="/vacode/54.1-529/">54.1-529</a> or renewed under subsection E of § <a href="/vacode/54.1-530/">54.1-530</a> for any reason for which the Director could have refused to grant or renew registration or for conduct that would justify refusal to issue a certificate of registration under subsection B of § <a href="/vacode/54.1-530/">54.1-530</a>.</p><p>2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0481" target="_blank" rel="noreferrer">481</a>, § 54.1-524.</p>',4),n=[i];function s(c,d,u,f,l,_){return r(),o("div",null,n)}const v=e(a,[["render",s]]);export{p as __pageData,v as default};
